import React, { useState, useEffect } from 'react';
import { Navigate } from 'react-router-dom';
import { fetchDataFromAPI } from './apiService';

const Dashboard = () => {
  const [apiKey, setApiKey] = useState(null);
  const [isLoading, setIsLoading] = useState(true);

  useEffect(() => {
    // Fetch data from the API
    fetchDataFromAPI("http://127.0.0.1:8000/api/usession")
      .then(apiData => {
        if (apiData && apiData.message === true) {
          setApiKey(apiData);
        } else {
          // setApiKey(false);
        }
      })
      .catch(error => {
        console.error('Error fetching data:', error);
        setApiKey(false);
      })
      .finally(() => {
        setIsLoading(false);
      });
  }, []);

  if (isLoading) {
    return <div>Loading...</div>;
  }

  // Check for apiKey.message after isLoading is false
  if (apiKey && apiKey.message === true) {
    return (
      <div>
        {/* Your Dashboard content here */}
        <h1>Welcome to the Dashboard</h1>
        {/* Add your Dashboard content */}
      </div>
    );
  } else if (apiKey === false) {
    return <Navigate to="/login" replace />;
  }

  // Handle other conditions or errors
  return <div>An unexpected error occurred.</div>;
};

export default Dashboard;
